localized.description:
Épisode final de la saison 1 de Wesh la school

Dans cet épisode, Tom fou dans la merde ses élèves, et une rencontre au sommet entre Yace et le père de Jawed,
Bref ça va barder !!!

On remercie aussi @mattias_bt d'avoir joué le jeu. Retrouvez son 2e single "Entre nous" ici : https://youtu.be/d800hUgSH7M

